pragma solidity ^0.4.22;

import "./ZoombieFactory.sol";

contract ZoombieHelper is ZoombieFactory {

    function getZoombieCount(address owner) public view returns (uint) {
        return zoombieOwnerCount[owner];
    }

    function getAllZoombie(address owner) public view returns (uint[]){
        uint zoombieOwnerCount = getZoombieCount(owner);
        uint[] memory ZoombieIdArray = new uint[](zoombieOwnerCount);
        for (uint i=0; i < zoombieArray.length ; i++){
            if (zombieToOwner[zoombieArray[i].id] == owner) {
                ZoombieIdArray[i] = zoombieArray[i].id;
            }
        }
        return ZoombieIdArray;
    }
}
